import './book.css';
import Navbar from '../Components/navbar.js';
import {useEffect, useState} from 'react';
import axios from 'axios';
export default function Book(){
   /* const[firstName,setFirstName]=useState('');
   const[lastName,setLastname]=useState('');
   const[mail,setMail]=useState('');
   const[guestCount,setGuestCount]=useState();

   const createBooking=()=>{
    const data={
      firstName,
      lastName,
      mail,
      guestCount
    }
    axios.post('http://localhost:5555/booking',data)
          .then(alert("done!"))
          .catch((err)=>{
              console.log(err);
          })
   }

   const showBooking=()=>{
    
    axios.post('http://localhost:5555/booking')
          .then((response)=>console.log(response.data))
          .catch((err)=>{
              console.log(err);
          })
   }
         */
   /* useEffect(()=>{
    axios.get('http://localhost:5555/booking')
            .then((response)=>console.log(response.data))
            .catch((err)=>{
                console.log(err);
            })
     }
   ) */

    return(
        <div>
            <section className="book-header">
                   <Navbar/>
            </section>
            <section className="book-body">
                   
                   <form className='bookForm'>
                        <div className='form-body'>
                        <div className='left-side'>
                        <label for="Name">Full name</label><br/>
                        <div className='section-left'>
                            <input type='text' placeholder='first name'/*  value={firstName} onChange={(e)=>setFirstName(e.target.value)} *//>
                            <input type='text' placeholder='last name' /* value={lastName} onChange={(e)=>setLastname(e.target.value)} *//>
                        </div>
                        <label for="guest">Number of Guest</label><br/>
                        <div className='section-left' >
                           <select className='dropdown' /* value={guestCount} onChange={(e)=>setGuestCount(e.target.value)} */>
                                <option value='1'>1</option>
                                <option value='2'>2</option>
                                <option value='3'>3</option>
                                <option value='4'>4</option>

                           </select>
                        </div>


                        <label for="guest">Arrival</label><br/>
                        <div className='section-left'>
                          <input type='date' placeholder='arrival data'/>
                          <input type='time' placeholder='arrival time'/>
                        </div>

                        <label for="guest">Departure</label><br/>
                        <div className='section-left'>
                          <input type='date' placeholder='departure data'/>
                          <input type='time' placeholder='departure time'/>
                        </div>

                        <label for="guest">pickup</label><br/>
                        <div className='section-left'>
                          <input type='checkbox' value='checked'/>Yes
                          <input type='checkbox' />No
                        </div>


                        </div>
                        <div className='right-side'>
                            <label for="mail">E-mail</label>
                            <div>
                            <input type='mail' placeholder='example@gmail.com' /* value={mail} onChange={(e)=>setMail(e.target.value)} */></input>
                            </div>
                            <label for="tp">Contact number</label>
                            <div>
                            <input type='tel' placeholder='contact number'></input>
                            </div>
                        </div>
                        </div>
                        <div className='form-footer'>
                         <button className='btnSubmit'/*  onClick={createBooking} */>Submit</button>
                         <button className='btnShow' /* onClick={showBooking} */>show</button>
                        </div>

                   </form>
            </section>
            <section className="book-footer">
              <h1>book List</h1>
               
            </section>
        </div>
    )
}
